import React from "react";
import Navbar from "./components/navbar";
import Hero from "./components/hero";
import Analytics from "./components/analytics";
import Newsletter from "./components/newsletter";

function App() {
  return (
    <div>
      <Navbar/>
      <Hero />
      <Analytics />
      <Newsletter />
     </div>
  );
}

export default App;
